var files = msg.payload;

files = files.replace(":","");
files = files.replace("../awsCerts","");
files = files.replace("-certificate.pem.crt", "");
files = files.replace("-private.pem.key","");
files = files.replace("-public.pem.key","");
files = files.replace("root-CA.crt","");

files = files.replace(/\r\n/g, "\n");
files = files.split("\n");


var uniqueKeys = files.filter(function(elem, pos) {
    return files.indexOf(elem) == pos;
})


msg.payload = uniqueKeys;
return msg;
